import { Link } from "react-router-dom"
import styles from "../components/layout/Cadastrar.module.css"
import { Button } from "@mui/material"
import styleButton from "../components/layout/StyleButton.module.css"
import styleBotaoCheck from "../components/layout/BotaoCheck.module.css"
import React, { useState } from "react";


function Cadastrar() {
    let selecionados = [];

    const [userinfo, setUserInfo] = useState({
        languages: [],
        response: [],
    });

    selecionados = selecionados.concat(userinfo.languages)
    const [primeiro, setPrimeiro] = useState(true);
    const [outro, setOutro] = useState(true);
    const [vale, setVale] = useState(true);
    const [dependentes, setDependentes] = useState(false);
    const [seguro, setSeguro] = useState(true);

    selecionados.push(primeiro)
    selecionados.push(outro)
    selecionados.push(seguro)
    selecionados.push(vale)
    selecionados.push(dependentes)
    const [inputs, setInputs] = useState([
        { id: 1, value: "" },
        { id: 2, value: "Data de " },
        { id: 3, value: "" },
        { id: 4, value: "" },
        { id: 5, value: "Grau de " },
        { id: 6, value: "Estado " },
        { id: 7, value: "" },
        { id: 8, value: "" },
        { id: 9, value: "" },
        { id: 10, value: "" },
        { id: 11, value: "E-" },
        { id: 12, value: "Tipo " },
        { id: 13, value: "" }, //Endereço
        { id: 14, value: "" },
        { id: 15, value: "Nº " },
        { id: 16, value: "" },
        { id: 17, value: "" },
        { id: 18, value: "" },
        { id: 19, value: "" },
        { id: 20, value: "Orgao " }, //RG
        { id: 21, value: "UF " },
        { id: 22, value: "Data " },
        { id: 23, value: "" }, //Carteira de habilitação
        { id: 24, value: "" },
        { id: 25, value: "" },
        { id: 26, value: "" }, //Título de eleitor
        { id: 27, value: "" },
        { id: 28, value: "" },
        { id: 29, value: "" }, // Carteira de Trabalho
        { id: 30, value: "" },
        { id: 31, value: "" },
        { id: 32, value: "" },
        { id: 33, value: "" }, //PIS
        { id: 34, value: "" },
        { id: 35, value: "" }, //Militar
        { id: 36, value: "" },
        { id: 37, value: "Primeiro " }, //Empregos
        { id: 38, value: "Possui outro vinculo empregatício" },
        { id: 39, value: "Está recebendo seguro desemprego" },
        { id: 40, value: "Qual vale deseja " },
        { id: 41, value: "Necessita de Vale Transporte" },
        { id: 42, value: "Possui dependentes" },
      ]);
    // const [inputs, setInputs] = useState({
    //     Nome: "",
    //     Data_Nascimento: "",
    //     Nacionalidade: "",
    //     Naturalidade: "",
    //     Grau_Instrução: "",
    //     Estado_Civil: "",
    //     Sexo: "",
    //     Raca: "",
    //     Filiacao: "",
    //     CPF: "",
    //     Email: "",
    //     Tipo_Sanguineo: "",
    //     Bairro: "",
    //     Cidade: "",
    //     N_Residencia: "",
    //     UF_endereco: "",
    //     CEP: "",
    //     Telefone: "",
    //     Pais: "",
    //     Orgao_Emissor_RG: "",
    //     UF_Emissao_RG: "",
    //     Data_Emissao_RG: "",
    //     Categoria_CNH: "",
    //     Numero_CNH: "",
    //     Vencimento_CNH: "",
    //     Zona_Titulo: "",
    //     Secao_Titulo: "",
    //     Numero_Titulo: "",
    //     Numero_CT: "",
    //     Serie_CT: "",
    //     UF_CT: "",
    //     Emissao_CT: "",
    //     Numero_PIS: "",
    //     Emissao_PIS: "",
    //     Numero_Militar: "",
    //     Emissao_Militar: "",
    //     Primeiro_Emprego: "",
    //     Possui_outro: "",
    //     RecebendoSeguroDesemprego: "",
    //     Vale: "",
    //     Vale_Transporte: "",
    //     Possui_dependentes: "",
    // });

    const handleChange = (e) => {
        const { value, checked } = e.target;
        const { languages } = userinfo;
        if (checked) {
            setUserInfo({
                languages: [...languages, value],
                response: [...languages, value],
            });
        }
        else {
            setUserInfo({
                languages: languages.filter((e) => e !== value),
                response: languages.filter((e) => e !== value),
            });
        }
    };
    const ChangeOpcPrimeiro = (e) => {
        setPrimeiro(e.target.value)
    }
    const ChangeOpcDependentes = (e) => {
        setDependentes(e.target.value)
    }
    const ChangeOpcVale = (e) => {
        setVale(e.target.value)
    }
    const ChangeOpcOutro = (e) => {
        setOutro(e.target.value)
    }
    const ChangeOpcSeguro = (e) => {
        setSeguro(e.target.value)
    }

    function handleInputChange(index, event) {
        console.log(event.target.value)
        console.log(event.target.name)
        const NovosInputs = [...inputs];
        console.log("INputs",NovosInputs);
        NovosInputs[index].value = event.target.value;
        setInputs(NovosInputs);
    }
    console.log(inputs)
    return (
        <div className="App">
            <header className="App-header">
                Cadastro
            </header>
            <br></br>
            <div className={styles.campos}>
                <form className={styles.form}>
                    <p className={styles.h1pe}>Informações Pessoais</p>
                    <input onChange={(e)=>handleInputChange(1,e)} placeholder="Nome" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(2,e)} placeholder="Data de Nascimento" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(3,e)} placeholder="Nacionalidade" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(4,e)} placeholder="Naturalidade" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(5,e)} placeholder="Grau de Instrução" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(6,e)} placeholder="Estado Civil" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(7,e)} placeholder="Sexo" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(8,e)} placeholder="Raça" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(9,e)} placeholder="Filiação" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(10,e)} placeholder="CPF" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(11,e)} placeholder="E-mail" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(12,e)} placeholder="Tipo Sanguíneo" type="text" className={styles.input} />
                    <p className={styles.h1pe}>Endereço</p>
                    <input onChange={(e)=>handleInputChange(13,e)} placeholder="Bairro" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(14,e)} placeholder="Cidade" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(15,e)} placeholder="Nº Residencia" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(16,e)} placeholder="UF" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(17,e)} placeholder="CEP" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(18,e)} placeholder="Telefone" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(19,e)} placeholder="País" type="text" className={styles.input} />
                    <p className={styles.h1pe}>RG</p>
                    <input onChange={(e)=>handleInputChange(20,e)} placeholder="Orgão Emissor" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(21,e)} placeholder="UF Emissão" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(22,e)} placeholder="Data Emissão" type="text" className={styles.input} />
                    <p className={styles.h1pe}>Carteira de Habilitação</p>
                    <input onChange={(e)=>handleInputChange(23,e)} placeholder="Categoria" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(24,e)} placeholder="Vencimento" type="text" className={styles.input} />
                    <p className={styles.h1pe}>Título de Eleitor</p>
                    <input onChange={(e)=>handleInputChange(25,e)} placeholder="Zona" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(26,e)} placeholder="Seção" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(27,e)} placeholder="Número" type="text" className={styles.input} />
                    <p className={styles.h1pe}>Carteira de Trabalho</p>
                    <input onChange={(e)=>handleInputChange(28,e)} placeholder="Número" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(29,e)} placeholder="Série" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(30,e)} placeholder="UF" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(31,e)} placeholder="Emissão" type="text" className={styles.input} />
                    <p className={styles.h1pe}>PIS</p>
                    <input onChange={(e)=>handleInputChange(32,e)} placeholder="Número" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(33,e)} placeholder="Emissão" type="text" className={styles.input} />
                    <p className={styles.h1pe}>Militar</p>
                    <input onChange={(e)=>handleInputChange(34,e)} placeholder="Número" type="text" className={styles.input} />
                    <input onChange={(e)=>handleInputChange(35,e)} placeholder="Emissão" type="text" className={styles.input} />
                    <p className={styles.h1pe}>Primeiro Emprego?</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Sim"
                        onChange={ChangeOpcPrimeiro}></input>
                    <p className={styles.text}>Sim</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Não"
                        onChange={ChangeOpcPrimeiro}></input>
                    <p className={styles.text}>Não</p>
                    <p className={styles.h1pe}>Possui outro vinculo empregatício?</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Sim"
                        onChange={ChangeOpcOutro}></input>
                    <p className={styles.text}>Sim</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Não"
                        onChange={ChangeOpcOutro}></input>
                    <p className={styles.text}>Não</p>
                    <p className={styles.h1pe}>Está recebendo seguro desemprego?</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Sim"
                        onChange={ChangeOpcSeguro}></input>
                    <p className={styles.text}>Sim</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Não"
                        onChange={ChangeOpcSeguro}></input>
                    <p className={styles.text}>Não</p>
                    <p className={styles.h1pe}>Qual vale deseja receber?</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Sim"
                        onChange={handleChange}></input>
                    <p className={styles.textlongo}>Vale Alimentação</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Não"
                        onChange={handleChange}></input>
                    <p className={styles.textlongor}>Vale Refeição</p>
                    <p className={styles.h1pe}>Necessita de vale transporte?</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Sim"
                        onChange={ChangeOpcVale}></input>
                    <p className={styles.text}>Sim</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="Não"
                        onChange={ChangeOpcVale}></input>
                    <p className={styles.text}>Não</p>
                    <p className={styles.h1pe}>Possui dependentes?</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="true"
                        onChange={ChangeOpcDependentes}></input>
                    <p className={styles.text}>Sim</p>
                    <input className={styleBotaoCheck.input} type="checkbox" name="check" value="false"
                        onChange={ChangeOpcDependentes}></input>
                    <p className={styles.text}>Não</p>
                    <br></br>
                    {dependentes === "true" && <div>
                        <input onChange={(e)=>handleInputChange(36,e)} placeholder="Nome dependente" type="text" className={styles.input} />
                        <input onChange={(e)=>handleInputChange(37,e)} placeholder="Nascimento dependente" type="text" className={styles.input} />
                    </div>}
                </form>
            </div>
            <br></br>
            <Link to={"/menu"} className={styleButton.button}>Cadastrar</Link>
            <Button class={styleButton.button} href="/menu" size="small">Voltar</Button>
        </div>
    )
}

export default Cadastrar
